import React, { useState } from "react"




export const JobList = () => {

  const [jobs, setJob] = useState([]);


    const renderJobs = (jobs) => {
      if(jobs.length){
    return jobs.map((job) => {
        return (
          <div>
            <div>
              <p>{job.neighborhood}</p>
            </div>
            <div>
              <p>{job.picture}</p>
            </div>
            <div>
              <p>{job.worker}</p>
            </div>
            <div>
              <p>{job.date}</p>
            </div>
          </div>
        )
    })  
    }

}
}

export default JobList
